Andre the Butcher (2005)

When a small group of decadent cheerleaders gets stranded on their way to the regional championship, they find refuge in an abandoned hunting lodge in the backwoods of Florida. When darkness falls, terror comes along in the form of local legend Andre the Butcher. All sinners must repent. For Andre is here to harvest souls for hell and turn human flesh into delicious chili.    

